import logo from './logo.svg';
import React from 'react';
import './index.css';

function joinLastName({ firstName , lastName }){
    return firstName + "-" + lastName;
}

const person = {
    firstName: "Dare",
    lastName: "Oyekunle"
}

function joinName() {
  return joinLastName(person);
}

export default joinName;
